import React from 'react'
import './program.css'
export default function Program() {
    return (
        <div>
            <div className="main">
            <input type="text" placeholder="First Name" />
            <input type="text" placeholder="Last Name"/>
            <button>Submit</button>
            </div>
        </div>
    )
}
